import React, { Component } from 'react'

export default class Button extends Component {
    render() {
        return (
            <div>
                <button>
                    underline me
                </button><br />
                <button>
                    Italicize me
                </button><br />
                <button>
                    I'm bold!
                </button>
            </div>
        )
    }
}
